import { StockProvider } from "./context/StockContext";
import { AuthProvider } from "./context/AuthContext";
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <PortfolioProvider>
    <StockProvider> 
    <AuthProvider> {/* ✅ Wrap App with PortfolioProvider */}
      <App />
      </AuthProvider>
      </StockProvider>
    </PortfolioProvider>
  </React.StrictMode>
);

reportWebVitals();
